pragma solidity ^0.8.0;

// SPDX-License-Identifier: MIT

library Utils {
    function randomUint(
        bytes memory seed,
        uint256 min,
        uint256 max
    ) public pure returns (uint256) {
        if (min >= max) {
            return min;
        }
        uint256 number = uint256(keccak256(seed));
        return (number % (max - min + 1)) + min;
    }

    function randomInt(
        bytes memory seed,
        int256 min,
        int256 max
    ) public pure returns (int256) {
        if (min >= max) {
            return min;
        }
        int256 number = int256(uint256(keccak256(seed)));
        return (number % (max - min + 1)) + min;
    }

    function randomWeight(
        bytes memory seed,
        uint256[] memory weights,
        uint256 totalWeight
    ) public pure returns (uint256) {
        uint256 number = randomUint(seed, 1, totalWeight);
        uint256 last;
        for (uint256 i = 0; i != weights.length - 1; i++) {
            last += weights[i];
            if (number <= last) {
                return i;
            }
        }
        return weights.length - 1;
    }

    function randomWeightR(
        bytes memory seed,
        uint256[] memory weights,
        uint256 totalWeight
    ) public pure returns (uint256) {
        uint256 number = randomUint(seed, 1, totalWeight);

        for (uint256 i = weights.length - 1; i != 0; --i) {
            if (number <= weights[i]) {
                return i;
            }
            number -= weights[i];
        }
        return 0;
    }

    function randomBool(
        bytes memory seed,
        uint256 nume,
        uint256 deno
    ) public pure returns (bool) {
        uint256 rand = randomUint(seed, 1, deno);
        return rand <= nume;
    }

